import React from 'react'

function apresentacao () {
  let obj ={
    name: "Ayrton",
    idade: 26
  }

  return <h1>Meu nome é {obj.name} e minha idade é {obj.idade} anos.</h1>
}

function App () {
  return(
    <>
      <apresentacao/>
      <apresentacao/>
      <apresentacao/>
    </>
  ) 
}

export default App
